import {
    NOT_TICKETS,CANCEL_TICKET,TICKETS,CANNOT_CANCEL } from '../action/type'

const initialState = {
    Tickets: {},
    loading: true
};

const tickets = (state = initialState, action)=>{
    const { type, payload } = action;
    switch (type) {
        case TICKETS:
            return {
                ...state,
                details: payload,
                loading: false
            };
        case NO_TICKETS:
            return {
                ...state,
                loading: false
            }
        default:
            return state
    }
}

export default tickets;
